import { TextField } from '@material-ui/core';
import React from 'react';

const Name = () => {
  const [name,setName] = setState()
  const handleName = (e) => {
    let updatedName = e.target.value
    this.setState({name : updatedName})
  }

  return (
  <div>
    <TextField 
      id ="name-basic"
      label="Name"
      onChange = {handleName}

    />
  </div>
  )  
}

export default Name
